import React, { Component } from 'react'

export default class Bigbox extends Component {
    render() {
        return (
                <div class="bigbox">

                    <div class="box1">
                        <p>Welcome To Cyborg</p> <br />
                        <h1><span style="color:rgb(208, 36, 94);"> BROWSE </span> OUR POPULAR<br /> GAMES HERE</h1> <br />
                        <button class="start">Browse Now</button>
                    </div>
                </div>


        )
    }
}
